import React from "react";
import {
  Table,
  TableBody,
  TableHead,
  TableRow,
  TableCell,
  Fab,
} from "@material-ui/core";
import AddIcon from "@material-ui/icons/Add";
import TableTaskItem from "./TableTaskItem";

export default function TableTask() {
  return (
    <Table sx={{ position: "relative", paddingBottom: "56px" }}>
      <TableHead>
        <TableRow></TableRow>
      </TableHead>
      <TableBody>
        <TableTaskItem />
        <TableTaskItem />
        <TableTaskItem />
      </TableBody>
      <Fab
        color="primary"
        sx={{ textAlign: "right" }}
        className="button-add"
        aria-label="add"
      >
        <AddIcon />
      </Fab>
    </Table>
  );
}
